    getAge(age2) {
        var from = age2.split("/");
        var birthdateTimeStamp = new Date(from[2], from[1] - 1, from[0]);
        var cur = new Date().getTime();
        var diff = cur - birthdateTimeStamp.getTime();
        var currentAge = Math.floor(diff / 31557600000);
        return currentAge;
    }
